import './App.css';
import { Router , Switch , Route} from 'react-router-dom';
import HeaderComponent from './components/HeaderComponent';
import CategoriesComponent from './components/CategoriesComponent';
import RecommendedComponent from './components/RecommendedComponent';
import ImageComponent from './components/ImageComponent';
import FooterComponent from './components/FooterComponent';

function App() {
  return (
    <Router>
      {/* <HeaderComponent /> */}
      <Route path='/header' component={HeaderComponent}></Route>
      <div class="container">
        {/* <CategoriesComponent />
        <RecommendedComponent />
        <ImageComponent /> */}
        <Route path='/cat' component={CategoriesComponent}></Route>
        <Route path='/rec' component={RecommendedComponent}></Route>
        <Route path='/img' component={ImageComponent}></Route>
      </div>  
      {/* <FooterComponent /> */}
      <Route path='/footer' component={FooterComponent}></Route>
      <Route path='/products' component={RecommendedComponent}></Route>
    </Router>

  );
}
export default App;
